import React from 'react';
import avatar from '../images'

function Projects (props) {
    return (
        // <div>
        //     <img src={img} alt={alt} />
        //     <h4>{name}</h4>
        //     <h4>{url}</h4>
        //     <h4>{repo}</h4>
        // </div>
        <section>
            <ul style={{ listStyle: 'none' }}>
                {props.projects.map(item => (
                    <li>
                        <img src={item.img} alt={item.alt} />
                        <h4>{item.name}</h4>
                        <h4>{item.url}</h4>
                        <h4>{item.repo}</h4>
                    </li>
                ))}

            </ul>
        </section>
    );
}

export default Projects;
